トラック専用電源線14pinオーディオハーネス<br>
■仕様<br>
平成5年以降の日野・いすゞ・三菱FUSO・日産UDに対応<br>
■外寸サイズ:縦19mm×横37mm<br>
※一部例外車両有り<br>
※差し込み口をご確認下さい。<br>
■取り付け<br>
純正オーディオデッキを取り外し、こちらのハーネスを差し込むだけで配線完了!<br>
電源や純正スピーカーをそのまま使え大変便利<br>
