●商品名：7インチモニター<br>
●消費電流：12v.500mA/24v.250mA<br>
●ビデオタイプ：NTSC/PAL<br>
●ビデオ入力レベル：1Vp-p,75ohm<br>
●画面サイズ：7インチLEDバックライト　LCD<br>
●解像度:800×480　WVGA<br>
●重量:約360g<br>
●サイズ：H183.5mmxW109.5mmxD16.5mm<br>
